import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ isAuthenticated, onLogout }) {
    return ( 
         <nav className="navbar navbar-expand-lg border-bottom" style={{ backgroundColor: "#FFF" }}>
            <div className="container p-2">
                <Link className="navbar-brand" to="/">
                    <img src="media/images/image.jpg" style={{ width: "25%" }} alt="Logo" />
                    <h3>hii</h3>
                </Link>
                
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav mb-lg-0">
                        {/* {!isAuthenticated && (
                            <>
                                <li className="nav-item">
                                    <Link className="nav-link active" aria-current="page" to="/login">Login</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link active" aria-current="page" to="/signup">Signup</Link>
                                </li>
                            </>
                        )} */}
                        <li className="nav-item">
                            <Link className="nav-link active" to="/about">About</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link active" to="/product">Product</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link active" to="/pricing">Pricing</Link>
                        </li>
                         <li className="nav-item">
                            <Link className="nav-link active" to="/support">Support</Link>
                        </li>
                        {isAuthenticated && (
                            <li className="nav-item">
                                <a className="nav-link active" href="http://localhost:3001/" target="_blank" rel="noopener noreferrer">Trade</a>
                            </li>
                        )}

                        {!isAuthenticated && (
                            <>
                                <li className="nav-item">
                                    <Link className="nav-link active" aria-current="page" to="/login">
                                   <button type="button" class="btn btn-danger">Login</button></Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link active" aria-current="page" to="/signup">
                                <button type="button" class="btn btn-warning">Signup</button>
                                  
                                    </Link>
                                </li>
                            </>
                        )}


                       
                        {isAuthenticated && (
                            <li className="nav-item">
                                <button className="nav-link btn" onClick={onLogout}>Logout</button>
                            </li>
                        )}
                    </ul>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
